          code: 401
          indent: 0
          parameters:
          - language after all. Isn't that convenient?
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'Now, there is the matter of how to go about acting on '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - the information listed here...
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'You see, that tablet over there describes how in '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - 'order to open the way forward, an actor must '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - perform a certain ritual.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'And this tablet here lists the actions necessary for '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - said ritual.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - And while I could simply tell you what's listed here...
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'Don''t you think it''s a bit dehumanizing to go about '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - 'fetching a disabled person just for the sake of '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - serving as a tool of transliteration?
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - I suppose you wouldn't.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - 'But I, for one, am discontent to play a passive, '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 0
          parameters:
          - intermediary role in all this.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - So, here's what we're going to do.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 0
          parameters:
          - I trust you are familiar with the game "Simon Says"?
        - !ruby/object:RPG::EventCommand
