        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
          parameters:
          - 'DANIELLE: Truly? Goodness, some folks are even '
        - !ruby/object:RPG::EventCommand
          code: 401
          indent: 1
          parameters:
          - more sheltered than I'd thought.
        - !ruby/object:RPG::EventCommand
          code: 101
          indent: 1
